  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Detroit
  River International Wildlife Refuge summarizes Refuge activities during the 2007
  calendar year. The report begins with a letter from Congressman John Dingell. Followed
  by an introduction to the Refuge and a summary of habitat conservation efforts.
  \ Information about research and monitoring including biological surveys for Grassy
  Island . Community engagement efforts are discussed along with capacity building
  efforts. Lastly, upcoming activities and investments are summarized.\",\n\t\"license_title\":
